import React from 'react';
import {Helmet} from 'react-helmet';
import './About.css';

const About = () => {
    return (
        <React.Fragment>
        <Helmet>
        <title>About</title>
        </Helmet>
        <div>About page content here  </div>
        </React.Fragment>
    );
}

export default About;
